import React, { useState } from "react";
import { NotificationIcon } from "./NotificationIcon";  // Notifications component

function UserDashboard() {
  const [communications, setCommunications] = useState([
    { company: "Company 1", type: "LinkedIn Post", date: "2023-09-01" },
    { company: "Company 2", type: "Email", date: "2023-10-20" }
  ]);
  const [overdueCount, setOverdueCount] = useState(1); // Example overdue count
  
  return (
    <div>
      <h2>User Dashboard</h2>
      <NotificationIcon count={overdueCount} />
      <div className="company-list">
        {communications.map((comm, index) => (
          <div key={index}>
            <h3>{comm.company}</h3>
            <p>{comm.type} - {comm.date}</p>
            <button onClick={() => alert("Communication logged!")}>Log Communication</button>
          </div>
        ))}
      </div>
    </div>
  );
}

export default UserDashboard;
